    <p class=MsoNormal align=center style='text-align:center'>When event 01 is selected,
    this is the delay. A longer delay moves the glue towards the handle. A
    shorter delay moves it towards the bottom of the bag. </p>
    <p class=MsoNormal align=center style='text-align:center'>When event 02 is
    selected, this is the glue length. Too small and <span class=GramE>it</span>
    wont shoot. Too much and it becomes too long. Try 0.5</p>
    </div>
